package com.leetcode.problem;

public class ShortestPalindrome
{
    public String shortestPalindrome(String s)
    {
        if (s.length() < 2)
        {
            return s;
        }

        for (int i = s.length(); i > 0; i--)
        {
            String temp = s.substring(0, i);
            if (isPalindrome(temp))
            {
                String prefix = new StringBuilder(s.substring(i, s.length())).reverse().toString();
                return prefix + s;
            }
        }

        return "";
    }

    private boolean isPalindrome(String s)
    {
        int start = (s.length() / 2) - 1;
        int end = (s.length() % 2 == 0) ? (s.length() / 2) : (s.length() / 2) + 1;

        int i = 0;
        while (start >= 0 && end < s.length())
        {
            if (s.charAt(start) != s.charAt(end))
            {
                return false;
            }

            if (s.charAt(i) != s.charAt(s.length() - i - 1))
            {
                return false;
            }

            i++;
            start--;
            end++;
        }

        return true;
    }

    public static void main(String[] args)
    {
        System.out.println(new ShortestPalindrome().shortestPalindrome("aacecaaa"));
        System.out.println(new ShortestPalindrome().shortestPalindrome("abcd"));
        System.out.println(new ShortestPalindrome().shortestPalindrome("baabcd"));
        System.out.println(new ShortestPalindrome().shortestPalindrome("aba"));
        System.out.println(new ShortestPalindrome().shortestPalindrome(
                ""));
    }
}
